import React from 'react';
  import { View, Text } from 'react-native';
  import { NavigationContainer } from '@react-navigation/native';
  import { createStackNavigator } from '@react-navigation/stack';
  import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
  import { TasksIcon, FeedIcon, FinanceIcon, ProfileIcon } from './icons';
  import styles from './styles/styles';
  import TasksScreen from './screens/TasksScreen';
  import FeedScreen from './screens/FeedScreen';
  import FinanceScreen from './screens/FinanceScreen';
  import ProfileScreen from './screens/ProfileScreen';
  import NewTaskScreen from './screens/NewTaskScreen';


  const Tab = createBottomTabNavigator();
  const Stack = createStackNavigator();

  function StackNavigator() {
    return (
      <Stack.Navigator>
        <Stack.Screen name="NewTaskScreen" component={NewTaskScreen} />
      </Stack.Navigator>
    );
  }

  function TabNavigator() {
    return (
        <Tab.Navigator
          initialRouteName="Задачи"
          screenOptions={({ route }) => ({
          tabBarIcon: ({ focused, color, size }) => {
            let icon;

            if (route.name === 'Задачи') {
              icon = focused ? <TasksIcon active /> : <TasksIcon />;
            } else if (route.name === 'Лента') {
              icon = focused ? <FeedIcon active /> : <FeedIcon />;
            } else if (route.name === 'Доходы') {
              icon = focused ? <FinanceIcon active /> : <FinanceIcon />;
            } else if (route.name === 'Профиль') {
              icon = focused ? <ProfileIcon active /> : <ProfileIcon />;
            }
            return icon;
          },
          tabBarActiveTintColor: styles.whiteColor.color, // Цвет активной вкладки
          tabBarInactiveTintColor: styles.darkGreyColor.color, // Цвет неактивной вкладки
          tabBarLabelStyle: styles.tabText, // Стили для текста во вкладках
          tabBarStyle: [styles.tabBar], // Стили для фона нижней навигационной панели и подняли ее выше
          })}
        >
        <Tab.Screen
          name="Задачи"
          component={TasksScreen}
          options={{
            tabBarLabel: '', // Устанавливаем пустую строку
            tabBarIcon: ({ focused, color, size }) => (
              <View style={styles.tabItem}>
                <TasksIcon active={focused} />
                <Text style={[styles.tabText, focused ? styles.tabTextActive : null]}>Задачи</Text>
              </View>
            ),
            headerShown: false,
          }}
        />

        <Tab.Screen
          name="Лента"
          component={FeedScreen}
          options={{
            tabBarLabel: '',
            tabBarIcon: ({ focused, color, size }) => (
              <View style={styles.tabItem}>
                <FeedIcon active={focused} />
                <Text style={[styles.tabText, focused ? styles.tabTextActive : null]}>Лента</Text>
              </View>
            ),
            headerShown: false,
          }}
        />
        <Tab.Screen
          name="Доходы"
          component={FinanceScreen}
          options={{
            tabBarLabel: '',
            tabBarIcon: ({ focused, color, size }) => (
              <View style={styles.tabItem}>
                <FinanceIcon active={focused}/>
                <Text style={[styles.tabText, focused ? styles.tabTextActive : null]}>Доходы</Text>
              </View>
            ),
            headerShown: false,
            }}
        />
        <Tab.Screen
          name="Профиль"
          component={ProfileScreen}
          options={{
            tabBarLabel: '',
            tabBarIcon: ({ focused, color, size }) => (
              <View style={styles.tabItem}>
                <ProfileIcon active={focused} />
                <Text style={[styles.tabText, focused ? styles.tabTextActive : null]}>Профиль</Text>
              </View>
            ),
            headerShown: false,
          }}
        />
        </Tab.Navigator>  
    );
  }

  function Navigation() {
    return (
      <NavigationContainer>
        <TabNavigator />
      </NavigationContainer>
    );
  }

  function NewTask() {
    return (
      <NavigationContainer>
        <StackNavigator />
      </NavigationContainer>
    );
  }

  export { Navigation, NewTask };
